  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Devils Lake Wetland
  Management District outlines Refuge accomplishments for the calendar year of 1970.
  The report begins by summarizing the water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, fur animals, predators,
  rodents, and other mammals, reptiles, and disease- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, collections
  and receipts, and vegetation control. Resource management is outlined; topics include
  grazing and fur harvesting. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, violations, and
  safety. Items of interest, N-R forms, photographs, and newspaper articles are attached.\",\n\t\"license_title\":
